            {
              "kind": "paragraph",
              "children": [
                {
                  "kind": "span",
                  "text": "Status register for inter-core FIFOs (mailboxes).\\n There is one FIFO in\n"
                },
                {
                  "kind": "span",
                  "text": "the core 0 -> core 1 direction, and one core 1 -> core 0. Both are 32\n"
                },
                {
                  "kind": "span",
                  "text": "bits wide and 8 words deep.\\n Core 0 can see the read side of the 1->0\n"
                },
                {
                  "kind": "span",
                  "text": "FIFO (RX), and the write side of 0->1 FIFO (TX).\\n Core 1 can see the\n"
                },
                {
                  "kind": "span",
                  "text": "read side of the 0->1 FIFO (RX), and the write side of 1->0 FIFO (TX).\\n\n"
                },
                {
                  "kind": "span",
                  "text": "The SIO IRQ for each core is the logical OR of the VLD, WOF and ROE\n"
                },
                {
                  "kind": "span",
                  "text": "fields of its FIFO_ST register.\n"
                }
              ]
            }
